answer:
To find $f(f(f(17)))$, we need to apply the function $f$ three times, each time using the value from the previous application as the input.

First, let's find $f(17)$:

\[f(17) = \left\{
\begin{array}{cl}
17-13 & \text{ since } 17 \geq 7, \\
= 4.
\end{array}
\right.\]

Now, let's find $f(4)$:

\[f(4) = \left\{
\begin{array}{cl}
4^2-4 & \text{ since } 4 < 7, \\
= 16-4, \\
= 12.
\end{array}
\right.\]

Finally, let's find $f(12)$:

\[f(12) = \left\{
\begin{array}{cl}
12-13 & \text{ since } 12 \geq 7, \\
= -1.
\end{array}
\right.\]

So, $f(f(f(17))) = -1$.

Final Answer: -1.

