The vertex of the parabola seems to be at the point $(-1, 8)$. Hence, the vertex form of the equation for the parabola is $f(x)=a(x+1)^2+8$ where we have factored out the $a$ and the $8$ is the $y$-value of the vertex.

We also see that the parabola passes through the point $(0, 7)$ which lies on the $y$-axis.

