$a=-1$

Since the graph is symmetric with respect to the vertex, we do not need to calculate $b$ directly as it does not appear in $a+b+2c$, and we can just calculate $2c$ using the y-intercept.

The y-intercept is at $(0, 7)$, which means when $x=0$, $y=c$. Therefore $c=7$, and $2c=14$.

So, without the need to calculate $b$, we now have $a=-1$ and $2c=14$. Plugging these into the equation $a+b+2c$ gives:

