To find $f(f(f(f(1+i))))$, we need to apply the function $f$ four times to the complex number $1+i$. The function $f$ is defined as:

\[f(z) = \left\{
\begin{array}{cl}
z^{2}&\text{ if }z\text{ is not real}, \\
-z^2 &\text{ if }z\text{ is real}.
\end{array}
\right.\]

First, let's determine whether $1+i$ is real or not. The real part of $1+i$ is $1$, which is a real number. The imaginary part of $1+i$ is $i$, which is not a real number since $i^{2} = -1$. Therefore, $1+i$ is not real.

Now, let's apply the function $f$ four times to $1+i$:

\[f(f(f(f(1+i)))) = f(f(f(z))) = f(z^{2}) = \left\{
\begin{array}{cl}
(z^{2})^{2} = z^{4}&\text{ if }z^{2}\text{ is not real}, \\
-(z^{2})^{2} = -z^{4} &\text{ if }z^{2}\text{ is real}.
\end{array}
\right.\]

Since $z^{2} = (1+i)^{2} = 1+2i+i^{2} = 1+2i-1 = i^{2} = -1$, we have that $z^{2}$ is not real. Therefore, $(z^{2})^{2} = z^{4}$ is also not real.

So, $f(f(f(f(1+i)))) = z^{4} = (1+i)^{4}$.

To find the final answer, we need to compute $(1+i)^{4}$. We can use the binomial theorem:

\[(1+i)^{4} = 1^{4} + 4\cdot1^{3}\cdot i + 6\cdot1^{2}\cdot i^{2} + 4\cdot1\cdot i^{3} + i^{4} = 1+4i+6i^{2}+4i^{3}+i^{4} = 1+5i+6(-1)+4(-1)-1 = 1-5i-6-4i-1 = -2i-7.\]

